import{_ as e,o as a,c as o,ae as n}from"./chunks/framework.DIXg7aqb.js";const u=JSON.parse('{"title":"Getting Started","description":"","frontmatter":{},"headers":[],"relativePath":"getting-started.md","filePath":"getting-started.md"}'),r={name:"getting-started.md"};function i(s,t,d,l,h,p){return a(),o("div",null,[...t[0]||(t[0]=[n('<h1 id="getting-started" tabindex="-1">Getting Started <a class="header-anchor" href="#getting-started" aria-label="Permalink to &quot;Getting Started&quot;">​</a></h1><p>Welcome to the XMapTools documentation! Whether you are a new or returning user, this guide will help you get XMapTools 4.5 up and running.</p><p>The installation and update procedures have changed in XMapTools 4.5. Most binaries now require <strong>MATLAB Runtime 25.1</strong>, which is installed automatically by the XMapTools installer. Older Runtime versions (e.g. v99 or v912) are no longer needed and can be safely deleted after upgrading.</p><p>XMapTools is distributed via shell scripts for <a href="/Documentation/installation_guide.html#macos">macOS</a> and <a href="/Documentation/installation_guide.html#windows">Windows</a> that automate the installation, update, download, extraction, and configuration of the program.</p><h2 id="compatibility" tabindex="-1">Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;Compatibility&quot;">​</a></h2><p>Before installing, make sure your system meets the requirements below:</p><table tabindex="0"><thead><tr><th>Version</th><th>Processor</th><th>Operating System</th><th>Runtime</th></tr></thead><tbody><tr><td><strong>macOS</strong></td><td>Apple Silicon (M1, M2, M3, M4, …)</td><td>macOS Sequoia (15), Sonoma (14), or Ventura (13)</td><td>R2025a (25.1)</td></tr><tr><td><strong>macOS Intel</strong></td><td>Intel</td><td>macOS Sequoia (15), Sonoma (14), or Ventura (13)</td><td>R2020b (v99)</td></tr><tr><td><strong>Windows</strong></td><td>x86-64</td><td>Windows 10 or Windows 11</td><td>R2025a (25.1)</td></tr></tbody></table><blockquote><p><strong>Note:</strong> The macOS version is <strong>not</strong> compatible with Intel processors, and the macOS Intel version is <strong>not</strong> stable with Apple Silicon processors. The installer auto-detects your architecture.</p></blockquote><h2 id="next-step" tabindex="-1">Next step <a class="header-anchor" href="#next-step" aria-label="Permalink to &quot;Next step&quot;">​</a></h2><p>Ready to install? Head over to the <a href="/Documentation/installation_guide.html">Installation &amp; Update Guide</a> for step-by-step instructions.</p><p>Is XMapTools already installed? If so, go straight <a href="/Documentation/getting-started-2.html">here</a>.</p>',11)])])}const g=e(r,[["render",i]]);export{u as __pageData,g as default};
